import { Grid, Image } from "@mui/material";
import * as React from 'react';
import savingsLogo from "./savings.svg";
function Home() {
  return (
    <Grid container justifyContent="center" alignItems="center">
      <Grid item>
        <Image src={savingsLogo} alt="Savings Logo" />
      </Grid>
    </Grid>
  );
}

export default Home;
